
mod = 10 ** 9 + 7


def numberOfCombinations(num):
    if num[0] == "0":
        return 0
    n = len(num)
    dp = [[-1 for _ in range(n)] for _ in range(n)]

    def backtrack(low, high):
        if high >= n:
            return 1
        if num[high] == "0":
            return 0
        if low != -1 and dp[low][high] != -1:
            return dp[low][high]
        last_num = num[low:high]
        last_num_len = len(last_num)
        candidates = []
        if last_num_len > 0 and high + last_num_len <= n and last_num <= num[high:high+last_num_len]:
            candidates.append((high, high+last_num_len))
        i = 1
        while high+last_num_len+i <= n:
            candidates.append((high, high+last_num_len+i))
            i += 1
        combinations = 0
        for candidate in candidates:
            combinations = combinations + (backtrack(candidate[0], candidate[1]) % mod) % mod
        dp[low][high] = combinations
        return combinations

    return backtrack(-1, 0)


print(numberOfCombinations("0"))  # 0
print(numberOfCombinations("094"))  # 0
print(numberOfCombinations("307"))  # 1
print(numberOfCombinations("327"))  # 2
print(numberOfCombinations("347"))  # 3
print(numberOfCombinations("3470"))  # 4
print(numberOfCombinations("3479"))  # 5
